import React from 'react';
import api from "../../server_api/api";
import Card from "../card/card";

class Pagination extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            len_apartments: this.props.len_apartments,

        }
    };

    // async componentDidMount(){
    //     const data = await this.getdata();
    //     let countries_array= [];
    //     data.data.apartments.map(item => {return countries_array.push(item.country)});
    //     this.setState({
    //         countries: Array.from(new Set(countries_array)),
    //     });
    // }
    //
    // async getdata(){
    //     const data = await api.getfilteredApartments(this.state.filtered);
    //     this.setState({
    //         apartments:data.data.apartments,
    //     });
    //
    //     return data
    // }



    render() {

        const {len_apartments} = this.state;
        const number_of_pages = Math.round(len_apartments/12);
        let arr_number_of_pages = [];
        for (let i = 1 ; i <= number_of_pages; i++){
            arr_number_of_pages.push(i);
        }

        console.log(len_apartments);
        console.log(arr_number_of_pages);

        return (
            <div>
                <nav aria-label="Page navigation example">
                    <ul className="pagination">
                        <li className="page-item">
                            <a className="page-link" href="#" aria-label="Previous">
                                <span aria-hidden="true">&laquo;</span>
                                <span className="sr-only">Previous</span>
                            </a>
                        </li>

                        {arr_number_of_pages.map((item, i) => {
                            return (
                                <li className="page-item"><a className="page-link" href="#" key={i} onClick={() => this.props.pageHandelClick(item)}>{item}</a></li>
                            )
                        })}

                        <li className="page-item">
                            <a className="page-link" href="#" aria-label="Next">
                                <span aria-hidden="true">&raquo;</span>
                                <span className="sr-only">Next</span>
                            </a>
                        </li>
                    </ul>
                </nav>
            </div>
        )
    }
}


export default Pagination;
